import Navbar from '../components/navbar';
import Head from 'next/head';

const Layout = (props) => (
    <div>
        <head>
            <title>BitzPrice</title> 
            <link rel="stylesheet" rel="https://bootswatch.com/4/cerulean/bootstrap.min.css"/>
        </head>
        <Navbar/>
        {props.children}
    </div>
);

export default Layout;
